// code for subroutines (not shown)
void wait_for_vsync(){
    volatile int * pixel_ctrl_ptr = 0xFF203020;
    register int status;

    *pixel_ctrl_ptr = 1; //start synchronization

    status = *(pixel_ctrl_ptr + 3); //look at the s bit in status register
    while ((status & 0x01) != 0){ //loop until s becomes 0
        status = *(pixel_ctrl_ptr + 3); //update status
    }

}

void draw_line(int x0, int y0, int x1, int y1, short int color){
    bool is_steep = abs(y1-y0) > abs(x1-x0);
    if (is_steep){ //simple swap
        int i = x0;
        x0 = y0;
        y0 = i;
        int j = x1;
        x1 = y1;
        y1 = j;
    }

    if (x0 > x1){
        int i = x0;
        x0 = x1;
        x1 = i;
        int j = y0;
        y0 = y1;
        y1 = j;
    }

    int dx = x1-x0;
    int dy = abs(y1-y0);
    int error = (-1)*(dx/2);
    int y =y0;
    int y_step = 0;
    if (y0<y1){
        y_step = 1;
    }
    else{
        y_step = -1;
    }

    //start the loop
    int current_x;
    for (current_x = x0; current_x <= x1; current_x++){
        if (is_steep){
            plot_pixel(y, current_x, color);
        }
        else{
            plot_pixel(current_x, y, color);
        }
        error = error + dy;
        if (error >= 0){
            y = y + y_step;
            error = error - dx;
        }
    }

}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

