//when the character is heading left
void draw_character_left(int x, int y, short int color){
    for (int current_x = x - 4; current_x < x + 3; current_x++){
        plot_pixel(current_x, y - 4, color);
        plot_pixel(current_x, y + 4, color);
    }

    for (int current_x = x - 3; current_x < x + 3; current_x++){
        plot_pixel(current_x, y - 3, color);
        plot_pixel(current_x, y + 3, color);
    }

     for (int current_x = x - 2; current_x < x + 4; current_x++){
        plot_pixel(current_x, y - 2, color);
        plot_pixel(current_x, y + 2, color);
    }

    for (int current_x = x - 1; current_x < x + 4; current_x++){
        plot_pixel(current_x, y - 1, color);
        plot_pixel(current_x, y + 1, color);
    }

    for (int current_x = x ; current_x < x + 5; current_x++){
        plot_pixel(current_x, y, color);
        plot_pixel(current_x, y, color);
    }


}



//when the character is heading right
void draw_character_right(int x, int y, short int color){
    for (int current_x = x + 4; current_x > x - 3; current_x--){
        plot_pixel(current_x, y - 4, color);
        plot_pixel(current_x, y + 4, color);
    }

    for (int current_x = x + 3; current_x > x - 3; current_x--){
        plot_pixel(current_x, y - 3, color);
        plot_pixel(current_x, y + 3, color);
    }

    for (int current_x = x + 2; current_x > x - 4; current_x--){
        plot_pixel(current_x, y - 2, color);
        plot_pixel(current_x, y + 2, color);
    }

    for (int current_x = x + 1; current_x > x - 4; current_x--){
        plot_pixel(current_x, y - 1, color);
        plot_pixel(current_x, y + 1, color);
    }

    for (int current_x = x ; current_x > x - 5; current_x--){
        plot_pixel(current_x, y, color);
        plot_pixel(current_x, y, color);
    }

}

//when the character is heading up
void draw_character_down(int x, int y, short int color){
    for (int current_y = y + 4; current_y > y - 3; current_y--){
        plot_pixel(x - 4, current_y, color);
        plot_pixel(x + 4, current_y, color);
    }

    for (int current_y = y + 3; current_y > y - 3; current_y--){
        plot_pixel(x - 3, current_y, color);
        plot_pixel(x + 3, current_y, color);
    }

    for (int current_y = y + 2; current_y > y - 4; current_y--){
        plot_pixel(x - 2, current_y, color);
        plot_pixel(x + 2, current_y, color);
    }

    for (int current_y = y + 1; current_y > y - 4; current_y--){
        plot_pixel(x - 1, current_y, color);
        plot_pixel(x + 1, current_y, color);
    }

    for (int current_y = y ; current_y > y - 5; current_y--){
        plot_pixel(x, current_y, color);
    }

}

//when the character is heading down
void draw_character_up(int x, int y, short int color){
    for (int current_y = y - 4; current_y < y + 3; current_y++){
        plot_pixel(x - 4, current_y, color);
        plot_pixel(x + 4, current_y, color);
    }

    for (int current_y = y - 3; current_y < y + 3; current_y++){
        plot_pixel(x - 3, current_y, color);
        plot_pixel(x + 3, current_y, color);
    }

    for (int current_y = y - 2; current_y < y + 4; current_y++){
        plot_pixel(x - 2, current_y, color);
        plot_pixel(x + 2, current_y, color);
    }

    for (int current_y = y - 1; current_y < y + 4; current_y++){
        plot_pixel(x - 1, current_y, color);
        plot_pixel(x + 1, current_y, color);
    }

    for (int current_y = y ; current_y < y + 5; current_y++){
        plot_pixel(x, current_y, color);
    }

}

//mosters are drawn in the same way no matter how they are moving
void draw_monster (int x, int y, short int color){
    for (int current_y = y; current_y < y + 5; current_y++){
        plot_pixel(x - 4, current_y, color);
        plot_pixel(x + 4, current_y, color);
    }

    for (int current_y = y - 2; current_y < y + 4; current_y++){
        plot_pixel(x - 3, current_y, color);
        plot_pixel(x + 3, current_y, color);
    }

    for (int current_y = y - 4; current_y < y + 3; current_y++){
        plot_pixel(x - 2, current_y, color);
        plot_pixel(x + 2, current_y, color);
    }

    for (int current_y = y - 4; current_y < y + 4; current_y++){
        plot_pixel(x - 1, current_y, color);
        plot_pixel(x + 1, current_y, color);
    }

    for (int current_y = y - 4; current_y < y + 5; current_y++){
        plot_pixel(x, current_y, color);
    }

}

void draw_box_food (int x, int y) {
    int box_size = 1;
    for (int i = x-box_size; i <= x+box_size; i++) {   //draw the box whose center is (x,y)
        for (int j = y - box_size; j <= y + box_size; j++) {
            plot_pixel(i, j, 0xFFFF);
            
        }
    }
}


