void eat_food(){
    for (int i = 0; i < NUM_POINTS; i++){
        if (abs(x_character-points[i].x) <= 6 && abs(y_character-points[i].y) <= 6){
            if (points[i].visited == false){
                points[i].visited = true;
                score = score + 10;
            }
        }
    }
}

void hex_display() {
    volatile int*HEX3_HEX0_ptr = (int*)0xFF200020;

    unsigned char seven_seg_decode_table[] = {
        0x3F, 0x06, 0x5B, 0x4F, 0x66, 0x6D, 0x7D, 0x07,
        0x7F, 0x67, 0x77, 0x7C, 0x39, 0x5E, 0x79, 0x71};

    unsigned char hex_segs[] = {0, 0, 0, 0};


    int thousands = score / 1000;
    int hundreds = (score - thousands * 1000) / 100;
    int tens = (score - thousands * 1000 - hundreds * 100) / 10;

    hex_segs[0] = seven_seg_decode_table[0]; //hex0 would always be 0
    hex_segs[1] = seven_seg_decode_table[tens];
    hex_segs[2] = seven_seg_decode_table[hundreds];
    hex_segs[3] = seven_seg_decode_table[thousands];

    *(HEX3_HEX0_ptr) =*(int*)(hex_segs);
}

void read_keyboard(){
    int PS2_data, RVALID;
    char byte1 = 0, byte2 = 0, byte3 = 0;

    PS2_data = *(PS2_ptr);
    RVALID   = PS2_data & 0x8000;
    if (RVALID){
        byte1 = byte2;
        byte2 = byte3;
        byte3 = PS2_data & 0xFF;
    }

    if (byte3 == (char)0x72){ //down
        direction_character = 3;
        dx_character = 0;
        dy_character = 2;
    }
    else if (byte3 == (char)0x75){ //up
        direction_character = 2;
        dx_character = 0;
        dy_character = -2;
    }
    else if (byte3 == (char)0x74){ //right
        direction_character = 1;
        dx_character = 2;
        dy_character = 0;
    }
    else if (byte3 == (char)0x6B){ //left
        direction_character = 0;
        dx_character = -2;
        dy_character = 0;
    }
}

